import React from 'react';

import LocationFrame from './HomeFrames/LocationFrame';
import FormFrame from './HomeFrames/FormFrame';
import MenuFrame from '../HomePage/HomeFrames/MenuFrame';

import video1 from '../../content/videos/video1.mp4';
import video2 from '../../content/videos/video2.mp4';
import video3 from '../../content/videos/video3.mp4';

import menuImg from '../../content/imgs/croissant.svg';

import '../../App.css';


export default class Home extends React.Component {
    render(){
        return(
            <>
                <MenuFrame video={video2} descr="Удивляем не только напитками, но и блюдами" img={menuImg}/>
                <FormFrame video= {video3} descr="Хочешь стать частью нашей команды?"/>
                <LocationFrame video ={video1} descr="Как нас найти?"/>
            </>
        );
    }
}
